import styled from "styled-components";

import React, { Component } from 'react';

export default styled.div`


  height: 450px;
  width: 100%;
  background: linear-gradient(to bottom, white, #6495ED, #1d9bef);
  color: #fff;
  margin: 0 15px;
  font-size: 1.5rem;
  border-radius:30px;
  margin-bottom:50px;
`;
